import 'bootstrap/dist/css/bootstrap.css';
import Dictionary from './Dictionary';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Dictionary</h1>
       <Dictionary/>
      </header>
      <footer> Open Source coded by Kira King </footer>
    </div>
  );
}

export default App;
